description:
So, this is a pretty strange recording. First, I have the date as June 11, but I think it&amp;#039;s from April 11. When I initially decided to offer it, I only listened to the first 5 minutes, which sounded OK. Listening to it in full, it has some issues. The first thing you&amp;#039;ll notice is the girl who screams at the beginning and end of each song. It&amp;#039;s kind of amusing, because Margo comments on it right before &quot;Blue Moon,&quot; laughing about what it would do to her singing voice and that it scares her.



Next is that the recording is somewhat subpar in sound quality. One of the delays in offering it was that I wasn&amp;#039;t sure whether to put it up or not, but decided it has enough historical value that it&amp;#039;d be interesting. I did some processing in Wavelab to try to even it out. First, I rendered the file with the Declicker and Denoiser plug-ins. After that, I applied a tube compression to it. It sounds better, but not perfect. I&amp;#039;d be interested in getting feedback on what you think of the processing.



The playing is pretty good overall. I like the Powderfinger. I love the &quot;Something More Besides You,&quot; and a mid-set &quot;Powderfinger&quot; offers an interesting contrast to &quot;State Trooper.&quot;
